        <div className="sidebar">
            {/* Twitter icon */}
            <TwitterIcon />
            {/* Sidebar Option */}
            <SidebarOption text = "home"/>
            {/* Sidebar Option */}
            <SidebarOption text = "explore"/>
            {/* Sidebar Option */}
            <SidebarOption text = "notifications"/>
            {/* Sidebar Option */}
            <SidebarOption text = "home"/>
            {/* Sidebar Option */}
            <SidebarOption text = "home"/>
            {/* Button -> Tweet */}
        </div>
    );
}

export default Sidebar;
